Method.Source:
public void insert()
{
    CustPaymModeTable custpaymmodetable;;
    SKS_EFT_FileFormatPaymSpec          SKS_EFT_FileFormatPaymSpec;
    ;

    ttsbegin;
    if(this.PaymMode != '')
    {
        custpaymmodetable = CustPaymModeTable::find(this.PaymMode);
        this.FormatId = custpaymmodetable.SKS_CNP_FormatId;
    }

    super();

    select firstOnly RecId from SKS_EFT_FileFormatPaymSpec
        where SKS_EFT_FileFormatPaymSpec.FormatId == this.FormatId &&
              SKS_EFT_FileFormatPaymSpec.PaymSpec == this.PaymSpec;

    this.CustReimbursementPaymLookupAddition(SKS_EFT_FileFormatPaymSpec, custpaymmodetable);

    ttscommit;
}

/// <summary>
///
/// </summary>
private void CustReimbursementPaymLookupAddition(SKS_EFT_FileFormatPaymSpec SKS_EFT_FileFormatPaymSpec, CustPaymModeTable lCustPaymModeTable)
{
    SKS_EFT_CustReimbursementPaymLookup            lSKS_EFT_CustReimbursementPaymLookup;
    SKS_EFT_FileFormatPaymSpecFields    SKS_EFT_FileFormatPaymSpecFields;
    RecordInsertList                    ril;

    ril = new RecordInsertList(lSKS_EFT_CustReimbursementPaymLookup.TableId);

    while select RecId, fixedvalue, defaultcodelookupvaluesrecid from SKS_EFT_FileFormatPaymSpecFields
        where SKS_EFT_FileFormatPaymSpecFields.fileformatpaymspecrecid == SKS_EFT_FileFormatPaymSpec.recid
    {
        lSKS_EFT_CustReimbursementPaymLookup.CodeLookupValuesRecId = SKS_EFT_FileFormatPaymSpecFields.DefaultCodeLookupValuesRecId;
        lSKS_EFT_CustReimbursementPaymLookup.FileFormatPaymSpecFieldsRecId = SKS_EFT_FileFormatPaymSpecFields.RecId;
        lSKS_EFT_CustReimbursementPaymLookup.CustReimbPaymRecId = this.RecId;
        lSKS_EFT_CustReimbursementPaymLookup.FixedValue = SKS_EFT_FileFormatPaymSpecFields.FixedValue;
        ril.add(lSKS_EFT_CustReimbursementPaymLookup);
    }
    ril.insertDatabase();
}

public static SKS_EFT_CustReimbursementPaym find(selectableDataArea _custCompany,
                                      CustAccount _custAccount,
                                      PaymMode _paymMode,
                                      PaymSpec _paymSpec,
                                      CustBankAccountId _custBankAccountId,
                                      boolean  _forUpdate = false)
{
    SKS_EFT_CustReimbursementPaym lSKS_EFT_CustReimbursementPaym;
    LogisticsPostalAddress logisticsPostalAddress;
    Array vendAddrArray = new Array(Types::String);

    if (_custCompany && _custAccount && _paymMode && _paymSpec && _custBankAccountId)
    {
        if (_forUpdate)
        {
            lSKS_EFT_CustReimbursementPaym.selectForUpdate(_forUpdate);
        }

        select lSKS_EFT_CustReimbursementPaym
            where lSKS_EFT_CustReimbursementPaym.CustCompany == _custCompany &&
                  lSKS_EFT_CustReimbursementPaym.CustAccount == _custAccount &&
                  lSKS_EFT_CustReimbursementPaym.PaymMode == _paymMode &&
                  lSKS_EFT_CustReimbursementPaym.PaymSpec == _paymSpec &&
                  lSKS_EFT_CustReimbursementPaym.CustBankAccountId == _custBankAccountId;
    }
    if (lSKS_EFT_CustReimbursementPaym.WBeneUseCustAddr && lSKS_EFT_CustReimbursementPaym.WBeneRemittanceLocation)
    {

        logisticsPostalAddress = LogisticsLocationEntity::location2PostalAddress(lSKS_EFT_CustReimbursementPaym.WBeneRemittanceLocation, DateTimeUtil::getSystemDateTime(), true);
        if (logisticsPostalAddress)
        {
            vendAddrArray = SKS_PP_50000Bas::StreetToAddressLineArray(logisticsPostalAddress.Street,2);
            if (vendAddrArray.exists(1))
            {
                lSKS_EFT_CustReimbursementPaym.WBeneAddr = vendAddrArray.value(1);
                if (vendAddrArray.exists(2))
                {
                    lSKS_EFT_CustReimbursementPaym.WBeneAddr2 = vendAddrArray.value(2);
                }
            }
            lSKS_EFT_CustReimbursementPaym.WBeneCity = logisticsPostalAddress.City;
            lSKS_EFT_CustReimbursementPaym.WBeneState = logisticsPostalAddress.State;
            lSKS_EFT_CustReimbursementPaym.WBeneZipPostal = logisticsPostalAddress.ZipCode;
            lSKS_EFT_CustReimbursementPaym.WBeneCountryRegionId = logisticsPostalAddress.CountryRegionId;
        }
    }
    return lSKS_EFT_CustReimbursementPaym;
}

static companyBankAccountId getBankAccountId(selectableDataArea _vendCompany,
                                      VendAccount _vendAccount,
                                      PaymMode _paymMode,
                                      PaymSpec _paymSpec,
                                      VendBankAccountId _vendBankAccountId)
{
    SKS_EFT_CustReimbursementPaym lSKS_EFT_CustReimbursementPaym;
    ;
    Select BankAccountId
        from lSKS_EFT_CustReimbursementPaym
        where lSKS_EFT_CustReimbursementPaym.CustCompany == _vendCompany &&
            lSKS_EFT_CustReimbursementPaym.CustAccount == _vendAccount &&
            lSKS_EFT_CustReimbursementPaym.PaymMode == _paymMode &&
            lSKS_EFT_CustReimbursementPaym.PaymSpec == _paymSpec &&
            lSKS_EFT_CustReimbursementPaym.CustBankAccountId == _vendBankAccountId;

    return lSKS_EFT_CustReimbursementPaym.BankAccountId;
}

/// <summary>
/// finds the record across company
/// </summary>
/// <param name = "_company"></param>
/// <param name = "_vendCompany"></param>
/// <param name = "_vendAccount"></param>
/// <param name = "_paymMode"></param>
/// <param name = "_paymSpec"></param>
/// <param name = "_vendBankAccountId"></param>
/// <param name = "_forUpdate"></param>
/// <returns></returns>
public static SKS_EFT_CustReimbursementPaym findByCompany(dataAreaId         _company,
                                               selectableDataArea _vendCompany,
                                               VendAccount        _vendAccount,
                                               PaymMode           _paymMode,
                                               PaymSpec           _paymSpec,
                                               VendBankAccountId  _vendBankAccountId,
                                               boolean            _forUpdate = false)
{
    SKS_EFT_CustReimbursementPaym lSKS_EFT_CustReimbursementPaym;

    if(_company)
    {
        changeCompany (_company)
        {
            lSKS_EFT_CustReimbursementPaym = SKS_EFT_CustReimbursementPaym::find(_vendCompany, _vendAccount, _paymMode, _paymSpec,_vendBankAccountId, _forUpdate);
        }
    }

    return lSKS_EFT_CustReimbursementPaym;
}
